package main

import (
	"encoding/base64"
	"fmt"
	"runtime"
)

func test() {
	content := ""
	//content := ""
	//content := ""
	bytes, err := base64.StdEncoding.DecodeString(content)
	if err != nil {
		fmt.Printf("err:%s\n", err)
		//return
	}
	fmt.Printf("bytes:%v\n", string(bytes))

	fmt.Printf(base64.StdEncoding.EncodeToString([]byte(bytes)))

}

func main() {
	arch := runtime.GOARCH
	fmt.Printf("arch:%v\n", arch)
	if arch == "amd64" || arch == "x86_64" {
		fmt.Println("Linux机器架构为 x86-64")
	} else if arch == "arm64" {
		fmt.Println("Linux机器架构为 ARM64")
	} else {
		fmt.Printf("未知的 Linux 机器架构 %s\n", arch)
	}
}
